import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <h1>Hello there!</h1>
      </React.Fragment>
    );
  }
}

export default App;
